import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router';
import LoginPage from './components/LoginPage'

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={Auth(LoginPage, null, true)} />

        </Switch>
      </div>
    </Router>
  );
}

export default App;
